import React, { useState } from "react";

const Main = () => {
  const [inputData, setinputData] = useState("");
  const [items, setitems] = useState([]);

  const addItems = () => {
    setitems([...items, inputData]);
    setinputData("");
  }

  return (
    <>
      <div>
        <div>
          <h1>Todo aap</h1>
          <div>
            <input type="text" placeholder="enter items to add" value={inputData} onChange={(e) => setinputData(e.target.value)}></input>
            <button onClick={addItems}>+</button>
          </div>
            <div className="data">
              {items.map((v)=>
             <ol>
               <li>{v}</li>
             </ol>
             
              )}
          
          </div>
        </div>
      </div>


    </>
  );
}
export default Main;
